import React from 'react';
import './styles.scss';

const Projects = () => {
  const projects = [
    {
      title: 'E-Commerce Platform',
      description: 'Aplikasi e-commerce fullstack dengan fitur keranjang belanja, pembayaran, dan manajemen produk',
      technologies: ['React', 'Node.js', 'MongoDB', 'Express', 'Redux'],
      imageUrl: '/projects/ecommerce.jpg',
      liveUrl: 'https://ecommerce-project.com',
      githubUrl: 'https://github.com/username/ecommerce'
    },
    {
      title: 'Project Management System',
      description: 'Sistem manajemen proyek untuk tim dengan fitur kolaborasi real-time',
      technologies: ['React', 'Firebase', 'Material-UI', 'Node.js'],
      imageUrl: '/projects/project-management.jpg',
      liveUrl: 'https://project-management.com',
      githubUrl: 'https://github.com/username/project-management'
    }
  ];

  return (
    <section className="projects" id="projects">
      <div className="container">
        <h2 className="section-title">Projects</h2>
        <div className="projects__grid">
          {projects.map((project, index) => (
            <div key={index} className="project-card">
              <div className="project-card__image">
                <img src={project.imageUrl} alt={project.title} />
              </div>
              <div className="project-card__content">
                <h3>{project.title}</h3>
                <p>{project.description}</p>
                <div className="project-card__tech">
                  {project.technologies.map((tech, i) => (
                    <span key={i} className="tech-tag">{tech}</span>
                  ))}
                </div>
                <div className="project-card__links">
                  <a href={project.liveUrl} target="_blank" rel="noopener noreferrer">Live Demo</a>
                  <a href={project.githubUrl} target="_blank" rel="noopener noreferrer">GitHub</a>
                </div>
              </div>
            </div>
          ))}
        </div>
      </div>
    </section>
  );
};

export default Projects;
